import Privilegio from "../models/Privilegio";

export const findAllPrivilegio = async (req, res) => {
    const allPrivilegio = await Privilegio.find();
    res.json(allPrivilegio);
}

export const findOnePrivilegio = async (req, res) => {
    const onePrivilegio = await Privilegio.findById(req.params.id);
    res.json(onePrivilegio);
}

export const findEmpleadoIdEmpleado = async (req, res) => {
    const EmpleadoIdEmpleado = await Empleado.find(req.params.IdEmpleado);
    res.json(EmpleadoIdEmpleado);
}

export const createEmpleado = async (req, res) => {
    const newEmpleado = new Empleado({
        IdEmpleado: req.body.IdEmpleado,
        Nombre: req.body.Nombre,
        Edad: req.body.Edad,
        Rol: req.body.Rol,
        Telefono: req.body.Telefono,
        Sueldo: req.body.Sueldo,
        Turno: req.body.Turno,
        Correo: req.body.Correo,
        Contrasea: req.body.Contrasea
    });
    const empleadoSaved = await newEmpleado.save();
    res.json(empleadoSaved);
}

export const deleteEmpleado = async (req, res) => {
    await Empleado.findByIdAndDelete(req.params.id);
    res.json({
        message: 'Empleado were deleted succesfully'
    });
}

export const updateEmpleado = async (req, res) => {
    await Empleado.findByIdAndUpdate(req.params.id, req.body);
    res.json({
        message: "Empleado was updated successfully"
    });
}

